import { BrowserRouter, Switch, Route } from 'react-router-dom';
import './App.css';
import Homepage from './Homepage/Homepage';
import Login from './Login/Login';
import AddStockMockup from './Widget/AddStockMockup/AddStockMockup';

function App() {
  return (
   <>
   <BrowserRouter>
   <Switch>

   <Route exact path="/" component={AddStockMockup}/>
   <Route path="/homepage" component={Homepage}/>
   </Switch>


   </BrowserRouter>


   </>
  );
}

export default App;
